float FIR_Filter(float newsample, float h[], float* x, int* newest) {

	/* local variable declaration */
	float y;
	int i, x_index;
	int temp;

	++* newest;

	if (*newest == N) *newest = 0;
	temp = *newest;
	x[temp] = newsample;

	y = 0;
	x_index = *newest;
	for (i = 0; i < N; i++) {
		y += h[i] * x[x_index];
		--x_index;
		if (x_index == -1)  x_index = N - 1;
	}
	return(y);

}



